  // imgAlt:'category rajibraj91 rajibraj',
  // iconName:'icofont-brand-windows',
  // title:'Colorful Bags',
  // },
  {
    imgUrl:'https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.pinimg.com%2Foriginals%2Fe7%2F5d%2Fdb%2Fe75ddbda351d44e24b6b8099fa200aad.jpg&tbnid=e1O1Yo-vn6PfPM&vet=12ahUKEwiR3vOSm7ODAxVgrycCHeLwCeoQMygHegQIARBj..i&imgrefurl=https%3A%2F%2Fin.pinterest.com%2Fpin%2Fdslr-camera--540291286554933760%2F&docid=61_8LblMjFcjaM&w=1080&h=1341&q=camera%20img&ved=2ahUKEwiR3vOSm7ODAxVgrycCHeLwCeoQMygHegQIARBj',
  imgAlt:'category rajibraj91 rajibraj',
  iconName:'icofont-brand-windows',
  title:'Home Decor',
  },
  ]


const HomeCategory = () => {
  return (
    <div className="category-section style-4">
        <div className="container">
            {/* section header */}
            <div className="section-header text-center">
        <span className="subtitle">{subTitle}</span>
        <h2 className="title">{title}</h2>
            </div>
            {/* section card */}
            <div className="section-wrapper">
            <div>
                {
                    categoryList.map((val , i) => (
                    <div key={i} className="col">
                      <Link to='/shop' className='category-item'>
                    <div className="category-inner">
                      <div className='category-thumb'>
                      <img src={val.imgUrl} alt="" />
                      </div>
                    </div>
                      </Link>
                    </div>
                    ))
                }
            </div>
            </div>
        </div>
    </div>
  )
}

export default HomeCategory
